import React from 'react';
import LineQRcode from "../../image/760eyprv.png"

function LineComp() {
    return (
        <>
            <div className = 'row mx-auto py-3' style = {{ width : "50vw" }}>
                <div className = 'col-md-6'>
                    <img src = {LineQRcode} className = "img-fluid"></img>
                </div>
            </div>
        </>
    );
}

export default LineComp;
